import { useNavigate } from "react-router-dom";

export default function Logout() {
  let navigate = useNavigate();
  localStorage.removeItem("userData");
  navigate("/");
  setTimeout(() => {
    window.location.reload();
  }, 1000); // Reload the page after 1 second
}
